import React from "react";
function CustomeHook() {
  // Declare a new state variable, which we'll call "count"

  const User = ({ name, email }) => {
    return (
      <article>
        <div class="card">
          <img
            src="http://localhost:3000/img_avatar.png"
            alt="Avatar"
            class="img"
          />

          <div class="container">
            <h4>
              <b>John Doe</b>
            </h4>
            <p>Architect & Engineer</p>
          </div>
        </div>
      </article>
    );
  };

  const UserInfo = () => {
    return (
      <section>
        <User name="test" email="test1234" />
      </section>
    );
  };

  return (
    <article>
      <div class="card">
        <img
          src="http://localhost:3000/img_avatar.png"
          alt="Avatar"
          class="img"
        />

        <div class="container">
          <h4>
            <b>John Doe</b>
          </h4>
          <p>Architect & Engineer</p>
        </div>
      </div>
    </article>
  );
}
export default CustomeHook;
